import React from "react";
import TittlePage from "./components/TittlePage";
import "./style/App.css";

import { ReactComponent as Sprite} from 'bootstrap-icons/bootstrap-icons.svg'

function App() {
  return (
    <>
      <Sprite />
      <TittlePage/>
    </>
  );
}

export default App;
